import React, {Component} from 'react';
import User from './User'

class Users extends Component{
    state = {
        users :[
            {
                name: 'A',
                age: '10'
            },
            {
                name: 'B',
                age: '20'
            }
        ]
    }
    render(){
        return(
           <div>
            {
                this.state.users.map((user)=>{
                    return <User>Name: {user.name} | Age: {user.age}</User>
                })
            }
           </div>
        )
    }
}
export default Users
